import React from "react";
import ListItem from "./ListItem"
function List() {
  return (
    <ul className="list-group">
<ListItem id='facebook' name="Facebook" img= "https://picsum.photos/id/1/200/20"/>
<ListItem id='youtube' name="Youtube" img= "https://picsum.photos/id/1/200/50"/>
<ListItem id='linkedin' name="LinkedIn" img= "https://picsum.photos/id/1/200/50"/>
    </ul>
  );
}
export default List
